import React from 'react';
import '../styles/Common.css';

function Analytics() {
  return (
    <div className="main-content">
      <h2>Analytics</h2>
      <div className="metrics">
        <p>Analytics data will be displayed here.</p>
      </div>
    </div>
  );
}

export default Analytics;
